script: |
  super -f text -I q11575.spq | sort > q11575.out

inputs:
  - name: q11575.spq
    data: |
      SELECT col2 * 9 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE ( NULL IN ( + - col1 + 28 - + - col0, + 10, - + col1 * - col1 + - CAST ( NULL AS INTEGER ) + + 95, - 69 / col0 * - 93 / + col1 ) );
  - name: tab1

outputs:
  - name: q11575.out
    data: |
